INSERT INTO `tbl_information` (`information_code`, `business_code`, `category_code`, `phone_number`, `picture`, `title`, `address`, `price`, `acreage`, `width`, `length`, `room`, `date_time`, `description`, `area_code`) VALUES
(3, 1, 1, 972935963, '161.jpg', 'Về quê tôi ', 'Quốc lộ 1K, Phường Bình An', 3, 30, 30, 30, 3, '2022-01', '-Tôi cần bán căn nhà xây dựng kiên cố,bê tông,cốt thép,làm để ở nên làm bằng tâm huyết của mình nay vì gđ\r\n\r\nchuyển về quê ở phụng dưỡng Bố Mẹ lớn tuổi nên cần bán.\r\n\r\n-Nhà tôi xây tháng 2 âm lịch năm nay 2023 vừa tròn 2 tháng,nhà mới 100%,thiết bị gia dụng tôi sử dụng toàn\r\n\r\nhàng tốt,hàng có thương hiệu nên nhìn nhà rất sang trọng và hiện đại.\r\n\r\n-Nhà tôi xây dựng có thiết kế rõ ràng,công năng sử dụng tối ưu,gồm sân xe hơi', 1),
(4, 1, 1, 913756723, '162.jpg', 'NGỘP BANK (', 'Phường Tân Định, Thị xã Bến Cát', 4, 40, 40, 40, 4, '2022-02', 'Tôi Chính Chủ Bán 2 Căn Nhà liền kề, mới, đẹp, hiện đại, có thang máy, nước nóng Năng lượng mặt trời, nội thất đầy đủ hiện đại ( gia đình chuyển công tác nên muốn bán để chuyển đổi)\r\n- Mặt Tiền: Ngô Quyền, Sơn Trà, Đà Nẵng. Đường rộng 10 làn xe, có thể xây khách sạn, mở quán ăn , xe 50 chỗ đậu thoải mái.\r\n- Gần Trường Học 200m- 600m cấp 1.2.3, gần chợ mai, chợ chiều 600m, gần siêu thị coopmart, vinmart, gần ủy ban . ra bãi biển 900m. Gần Bà Linh ứng, quán Hải Sản Bé Mặn, Eo Biển nổi tiếng . Gần ', 1),
(5, 1, 1, 373475903, '163.jpg', 'cần 200tr s', '39, Ngô Quyền, Phường Thọ Quang, Quận Sơn Trà', 2.5, 40, 50, 60, 7, '2022-03', 'Nhà xây hoàn thiện 1 trệt 1 lầu đúc bê tông kiên cố trên diện tích 5 v15 =75 m2 đất ở đô thị (thổ cư).Nhà rất rộng,đẹp,yên tĩnh,an ninh,thoáng mát.bao gồm 2 phòng ngủ riêng,2 phòng khách rộng,2 phòng vệ sinh,bếp,ban công,sân....điện nước riêng biệt.Đường đi 3m.hẻm xe hơi.Tất cả sẵn sàng chi vào là ở.Giấy tờ đầy đủ có sẵn hợp lệ.(không thuộc quy hoạch,không tranh chấp...)Địa chỉ hẻm 470 đường 925 khu vực Thạnh Hưng, phường Thường Thạnh,quận Cái Răng,tp.Cần Thơ. Giá1 tỷ 150 rất phù hợp..Cảm ơn quý', 1),
(6, 1, 1, 768614693, '164.jpg', 'Bán gấp 2 c', 'Hẻm nhà trọ 470, Đường 925', 5, 40, 50, 60, 7, '2022-04', 'Mô tả:\r\n?Nhà thiết kế 3 tầng đúc BTCT gồm phòng khách, phòng bếp, 3 phòng ngủ, phòng giặc, ban công.\r\n?Vị trí ngay trung tâm gần chợ Tân Định gần mặt tiền, tương lai ra mặt tiền giá trị tăng cao.\r\n?Nhà chính chủ mấy chục năm đến nay.\r\nPhù hợp mua ở, cho thuê, đầu tư, Phụ huynh mua cho con đi học.\r\n?Khu vực rất hiếm nhà bán, chỉ 2 tỷ2 tìm nhà 3 tầng đúc Quận 1 không ra.\r\n?Giấy tờ pháp lý chuẩn, công chứng ngay.', 1),
(7, 1, 1, 937930354, '165.jpg', 'Nhà cần bán', 'Trần Khắc Chân, Phường Tân Định', 7, 40, 50, 60, 7, '2022-05', '2 MẶT HẺM XE TẢI TRƯỚC SAU - CHDV - MB+15 PHÒNG - DÒNG TIỀN THU VỀ HƠN 600TR/NĂM - 151m2 - 4 TẦNG - CHỈ 13 TỶ - BAO ĐẦU TƯ\r\n\r\n- Hẻm nhựa trước nhà 6m thẳng 1 trục, cách mặt tiền 40m, thông tứ tung. Hẻm sau 5m, sạch sẽ, an ninh.\r\n\r\n- Diện tích: 151m2 ngang 4.7m2 nở hậu 10,7m, dài 20m.\r\n\r\n- CHDV: Kết cấu 1 trệt 3 lầu. Gồm mặt bằng dưới, 15 phòng khép kín. Có dòng tiền ổn định 600tr/năm.', 1),
(8, 1, 1, 902514989, '166.jpg', '12 TỶ/CĂN, ', 'Bùi Quang Là, Phường 12', 5, 40, 50, 60, 7, '2022-06', '+ Bán Nhà Hẻm Xe Tải Tống Văn Trân, Phường 5, Quận 11, 70m2, 9 TỶ HẠ CÒN 6.3 TỶ, RẺ BẤT NGỜ, 4 Phòng\r\n\r\n------------------------------------\r\n\r\n+ Chủ Kẹt tiền cần bán gấp 6.3 tỷ thương lượng.\r\n\r\n+ Liên hệ Mr Đồng – Bất động sản. Xem và tư vấn MIỄN PHÍ, gặp CHÍNH CHỦ thương lượng giá, CAM KẾT KHÔNG KÊ GIÁ dưới mọi hình thức.\r\n\r\n* Miễn môi giới, trung gian, báo mạng.', 1),
(9, 1, 1, 969255105, '167.jpg', 'Bán biệt th', 'Tống Văn Trân, Phường 5', 3, 40, 50, 60, 7, '2022-07', 'Bán biệt thự đơn lập Verosa Park Khang Điền Quận 9 (TP. Thủ Đức) ***\r\n- Diện tích đất: 528m², ngang 20x26.\r\n- Xây 1 trệt 2 lầu, dtxd 485m².\r\n- Thiết kế mẫu được: 2 phòng khách, 1 phòng bếp, 5PN 6WC, 1 phòng thờ - phòng làm việc - phòng thư giãn - 4 sân vườn bao quanh nhà.\r\n- Pháp lý: Đã có sổ, công chứng sang tên ngay.\r\n- Hiện trạng: Hoàn thiện mặt ngoài, thô bên trong.\r\n- Tiện ích: Hồ bơi, gym, công viên đã hiện hữu và cư dân đang bắt đầu về ở.', 1),
(10, 1, 1, 522452021, '168.jpg', 'NHÀ MỚI 1 T', 'Liên Phường, Phường Phú Hữu', 6, 40, 50, 60, 7, '2022-08', 'Bán Nhà 2.5 Tầng nằm tổ 2 thanh lãm. Phường phú lãm hà đông\r\nDiện tích 37m2\r\nNgõ rộng 2m. Cách đường ô tô 80m\r\nVị trí nằm ngõ 9 thanh lãm. Gần trường mầm non. Cấp 1 2', 1),
(11, 1, 1, 904789542, '169.jpg', 'BÁN NHÀ 151', 'Đường Số 22', 8, 40, 50, 60, 7, '2022-09', '- Vị trí mặt phố ô tô tránh, ngay sát hồ Bồ Đề và chợ dân sinh, khu vực dân cư đông đúc, kinh doanh sầm uất.\r\n- Trường cấp 1,2 cách nhà 200m, trong bán kính 500m là bệnh viện Tâm Anh, Trường QT Wellsprings, công an Phường\r\n- Nhà chủ tự xây ở nên rất chắc chắn, dù ở được chục năm nhưng vẫn mới, bên cạnh nhà có khe thoáng 50cm, do vậy phòng nào cũng thoáng sáng. Nhà phù hợp vừa ở vừa kinh doanh.\r\n- Diện tích nhà 40 m2, mặt tiền 7m, nhà xây 4 tầng đầy đủ công năng.\r\n- Thiết kế:\r\n+ Tầng 1: Thông sàn', 1),
