(48, 1, 1, 972935963, '4.jpg', 'NGỘP BANK (', 'Bùi Quang Là, Phường 12', 5, 45, 60, 130, 2, '2022-06', '+ Bán Nhà Hẻm Xe Tải Tống Văn Trân, Phường 5, Quận 11, 70m2, 9 TỶ HẠ CÒN 6.3 TỶ, RẺ BẤT NGỜ, 4 Phòng\r\n\r\n------------------------------------\r\n\r\n+ Chủ Kẹt tiền cần bán gấp 6.3 tỷ thương lượng.\r\n\r\n+ Liên hệ Mr Đồng – Bất động sản. Xem và tư vấn MIỄN PHÍ, gặp CHÍNH CHỦ thương lượng giá, CAM KẾT KHÔNG KÊ GIÁ dưới mọi hình thức.\r\n\r\n* Miễn môi giới, trung gian, báo mạng.', 4),
(49, 1, 1, 913756723, '5.jpg', 'cần 200tr s', 'Tống Văn Trân, Phường 5', 9, 45, 60, 130, 2, '2022-07', 'Bán biệt thự đơn lập Verosa Park Khang Điền Quận 9 (TP. Thủ Đức) ***\r\n- Diện tích đất: 528m², ngang 20x26.\r\n- Xây 1 trệt 2 lầu, dtxd 485m².\r\n- Thiết kế mẫu được: 2 phòng khách, 1 phòng bếp, 5PN 6WC, 1 phòng thờ - phòng làm việc - phòng thư giãn - 4 sân vườn bao quanh nhà.\r\n- Pháp lý: Đã có sổ, công chứng sang tên ngay.\r\n- Hiện trạng: Hoàn thiện mặt ngoài, thô bên trong.\r\n- Tiện ích: Hồ bơi, gym, công viên đã hiện hữu và cư dân đang bắt đầu về ở.', 4),
(50, 1, 1, 373475903, '6.jpg', 'Bán gấp 2 c', 'Liên Phường, Phường Phú Hữu', 10.19, 45, 60, 130, 2, '2022-08', 'Bán Nhà 2.5 Tầng nằm tổ 2 thanh lãm. Phường phú lãm hà đông\r\nDiện tích 37m2\r\nNgõ rộng 2m. Cách đường ô tô 80m\r\nVị trí nằm ngõ 9 thanh lãm. Gần trường mầm non. Cấp 1 2', 4),
(51, 1, 2, 768614693, '8.jpg', 'Nhà cần bán', 'Đường Số 22', 7, 45, 60, 130, 2, '2022-09', '- Vị trí mặt phố ô tô tránh, ngay sát hồ Bồ Đề và chợ dân sinh, khu vực dân cư đông đúc, kinh doanh sầm uất.\r\n- Trường cấp 1,2 cách nhà 200m, trong bán kính 500m là bệnh viện Tâm Anh, Trường QT Wellsprings, công an Phường\r\n- Nhà chủ tự xây ở nên rất chắc chắn, dù ở được chục năm nhưng vẫn mới, bên cạnh nhà có khe thoáng 50cm, do vậy phòng nào cũng thoáng sáng. Nhà phù hợp vừa ở vừa kinh doanh.\r\n- Diện tích nhà 40 m2, mặt tiền 7m, nhà xây 4 tầng đầy đủ công năng.\r\n- Thiết kế:\r\n+ Tầng 1: Thông sàn', 4),
(52, 1, 2, 937930354, '9.jpg', '12 TỶ/CĂN, ', 'Phố Bồ Đề, Phường Bồ Đề', 9, 45, 60, 130, 2, '2022-10', '?12 tỷ căn / TL mạnh trả giá là bán\r\n\r\nBán 2 căn Biệt Thự 2 MT KDC Phú Hồng Thịnh 10, Full nội thất cao cấp, p.Bình An, Tp.Dĩ An\r\n\r\nDT: 111,9m2 thổ cư 100% ( 7,6X16m )\r\nDT sàn thực tế 500m2\r\n\r\nNgay đường Quốc Lộ 1K, BigC GO, Làng Đại Học Quốc Gia Tp.HCM, gần Thủ Đức\r\n\r\nThiết kế: 1 trệt 4 lầu đúc 5 tấm, Gara Ô tô 7 chỗ, 2 phòng khách, nhà ăn, 4 phòng ngủ master có nhà vệ sinh bên trong, 7wc, phòng Karaoke, phòng thờ, phòng giặt, sân thượng, ban công,', 4),
(53, 1, 2, 902514989, '10.jpg', 'Bán biệt th', 'Quốc lộ 1K, Phường Bình An', 2, 45, 60, 130, 2, '2022-11', '-Tôi cần bán căn nhà xây dựng kiên cố,bê tông,cốt thép,làm để ở nên làm bằng tâm huyết của mình nay vì gđ\r\n\r\nchuyển về quê ở phụng dưỡng Bố Mẹ lớn tuổi nên cần bán.\r\n\r\n-Nhà tôi xây tháng 2 âm lịch năm nay 2023 vừa tròn 2 tháng,nhà mới 100%,thiết bị gia dụng tôi sử dụng toàn\r\n\r\nhàng tốt,hàng có thương hiệu nên nhìn nhà rất sang trọng và hiện đại.\r\n\r\n-Nhà tôi xây dựng có thiết kế rõ ràng,công năng sử dụng tối ưu,gồm sân xe hơi', 4),
(54, 1, 2, 969255105, '11.jpg', 'NHÀ MỚI 1 T', 'Phường Tân Định, Thị xã Bến Cát', 3, 45, 60, 130, 2, '2022-12', 'Tôi Chính Chủ Bán 2 Căn Nhà liền kề, mới, đẹp, hiện đại, có thang máy, nước nóng Năng lượng mặt trời, nội thất đầy đủ hiện đại ( gia đình chuyển công tác nên muốn bán để chuyển đổi)\r\n- Mặt Tiền: Ngô Quyền, Sơn Trà, Đà Nẵng. Đường rộng 10 làn xe, có thể xây khách sạn, mở quán ăn , xe 50 chỗ đậu thoải mái.\r\n- Gần Trường Học 200m- 600m cấp 1.2.3, gần chợ mai, chợ chiều 600m, gần siêu thị coopmart, vinmart, gần ủy ban . ra bãi biển 900m. Gần Bà Linh ứng, quán Hải Sản Bé Mặn, Eo Biển nổi tiếng . Gần ', 4),
(55, 1, 2, 522452021, '12.jpg', 'BÁN NHÀ 151', '39, Ngô Quyền, Phường Thọ Quang, Quận Sơn Trà', 4, 45, 60, 130, 2, '2022-01', 'Nhà xây hoàn thiện 1 trệt 1 lầu đúc bê tông kiên cố trên diện tích 5 v15 =75 m2 đất ở đô thị (thổ cư).Nhà rất rộng,đẹp,yên tĩnh,an ninh,thoáng mát.bao gồm 2 phòng ngủ riêng,2 phòng khách rộng,2 phòng vệ sinh,bếp,ban công,sân....điện nước riêng biệt.Đường đi 3m.hẻm xe hơi.Tất cả sẵn sàng chi vào là ở.Giấy tờ đầy đủ có sẵn hợp lệ.(không thuộc quy hoạch,không tranh chấp...)Địa chỉ hẻm 470 đường 925 khu vực Thạnh Hưng, phường Thường Thạnh,quận Cái Răng,tp.Cần Thơ. Giá1 tỷ 150 rất phù hợp..Cảm ơn quý', 5),
