(90, 1, 2, 373475903, '47.jpg', 'Bán gấp 2 c', 'Liên Phường, Phường Phú Hữu', 10, 45, 60, 130, 2, '2022-12', 'Bán Nhà 2.5 Tầng nằm tổ 2 thanh lãm. Phường phú lãm hà đông\r\nDiện tích 37m2\r\nNgõ rộng 2m. Cách đường ô tô 80m\r\nVị trí nằm ngõ 9 thanh lãm. Gần trường mầm non. Cấp 1 2', 7),
(91, 1, 2, 768614693, '48.jpg', 'Nhà cần bán', 'Đường Số 22', 6, 45, 60, 130, 2, '2022-01', '- Vị trí mặt phố ô tô tránh, ngay sát hồ Bồ Đề và chợ dân sinh, khu vực dân cư đông đúc, kinh doanh sầm uất.\r\n- Trường cấp 1,2 cách nhà 200m, trong bán kính 500m là bệnh viện Tâm Anh, Trường QT Wellsprings, công an Phường\r\n- Nhà chủ tự xây ở nên rất chắc chắn, dù ở được chục năm nhưng vẫn mới, bên cạnh nhà có khe thoáng 50cm, do vậy phòng nào cũng thoáng sáng. Nhà phù hợp vừa ở vừa kinh doanh.\r\n- Diện tích nhà 40 m2, mặt tiền 7m, nhà xây 4 tầng đầy đủ công năng.\r\n- Thiết kế:\r\n+ Tầng 1: Thông sàn', 8),
(92, 1, 2, 937930354, '49.jpg', '12 TỶ/CĂN, ', 'Phố Bồ Đề, Phường Bồ Đề', 8, 45, 60, 130, 2, '2022-02', '?12 tỷ căn / TL mạnh trả giá là bán\r\n\r\nBán 2 căn Biệt Thự 2 MT KDC Phú Hồng Thịnh 10, Full nội thất cao cấp, p.Bình An, Tp.Dĩ An\r\n\r\nDT: 111,9m2 thổ cư 100% ( 7,6X16m )\r\nDT sàn thực tế 500m2\r\n\r\nNgay đường Quốc Lộ 1K, BigC GO, Làng Đại Học Quốc Gia Tp.HCM, gần Thủ Đức\r\n\r\nThiết kế: 1 trệt 4 lầu đúc 5 tấm, Gara Ô tô 7 chỗ, 2 phòng khách, nhà ăn, 4 phòng ngủ master có nhà vệ sinh bên trong, 7wc, phòng Karaoke, phòng thờ, phòng giặt, sân thượng, ban công,', 8),
(93, 1, 2, 902514989, '50.jpg', 'Bán biệt th', 'Quốc lộ 1K, Phường Bình An', 11, 45, 60, 130, 2, '2022-03', '-Tôi cần bán căn nhà xây dựng kiên cố,bê tông,cốt thép,làm để ở nên làm bằng tâm huyết của mình nay vì gđ\r\n\r\nchuyển về quê ở phụng dưỡng Bố Mẹ lớn tuổi nên cần bán.\r\n\r\n-Nhà tôi xây tháng 2 âm lịch năm nay 2023 vừa tròn 2 tháng,nhà mới 100%,thiết bị gia dụng tôi sử dụng toàn\r\n\r\nhàng tốt,hàng có thương hiệu nên nhìn nhà rất sang trọng và hiện đại.\r\n\r\n-Nhà tôi xây dựng có thiết kế rõ ràng,công năng sử dụng tối ưu,gồm sân xe hơi', 8),
(94, 1, 2, 969255105, '51.jpg', 'NHÀ MỚI 1 T', 'Phường Tân Định, Thị xã Bến Cát', 4, 45, 60, 130, 2, '2022-04', 'Tôi Chính Chủ Bán 2 Căn Nhà liền kề, mới, đẹp, hiện đại, có thang máy, nước nóng Năng lượng mặt trời, nội thất đầy đủ hiện đại ( gia đình chuyển công tác nên muốn bán để chuyển đổi)\r\n- Mặt Tiền: Ngô Quyền, Sơn Trà, Đà Nẵng. Đường rộng 10 làn xe, có thể xây khách sạn, mở quán ăn , xe 50 chỗ đậu thoải mái.\r\n- Gần Trường Học 200m- 600m cấp 1.2.3, gần chợ mai, chợ chiều 600m, gần siêu thị coopmart, vinmart, gần ủy ban . ra bãi biển 900m. Gần Bà Linh ứng, quán Hải Sản Bé Mặn, Eo Biển nổi tiếng . Gần ', 8),
(95, 1, 2, 522452021, '52.jpg', 'BÁN NHÀ 151', '39, Ngô Quyền, Phường Thọ Quang, Quận Sơn Trà', 3, 45, 60, 130, 2, '2022-05', 'Nhà xây hoàn thiện 1 trệt 1 lầu đúc bê tông kiên cố trên diện tích 5 v15 =75 m2 đất ở đô thị (thổ cư).Nhà rất rộng,đẹp,yên tĩnh,an ninh,thoáng mát.bao gồm 2 phòng ngủ riêng,2 phòng khách rộng,2 phòng vệ sinh,bếp,ban công,sân....điện nước riêng biệt.Đường đi 3m.hẻm xe hơi.Tất cả sẵn sàng chi vào là ở.Giấy tờ đầy đủ có sẵn hợp lệ.(không thuộc quy hoạch,không tranh chấp...)Địa chỉ hẻm 470 đường 925 khu vực Thạnh Hưng, phường Thường Thạnh,quận Cái Răng,tp.Cần Thơ. Giá1 tỷ 150 rất phù hợp..Cảm ơn quý', 8),
(96, 1, 2, 904789542, '53.jpg', 'Chính Chủ B', 'Hẻm nhà trọ 470, Đường 925', 5, 45, 60, 130, 2, '2022-06', 'Mô tả:\r\n?Nhà thiết kế 3 tầng đúc BTCT gồm phòng khách, phòng bếp, 3 phòng ngủ, phòng giặc, ban công.\r\n?Vị trí ngay trung tâm gần chợ Tân Định gần mặt tiền, tương lai ra mặt tiền giá trị tăng cao.\r\n?Nhà chính chủ mấy chục năm đến nay.\r\nPhù hợp mua ở, cho thuê, đầu tư, Phụ huynh mua cho con đi học.\r\n?Khu vực rất hiếm nhà bán, chỉ 2 tỷ2 tìm nhà 3 tầng đúc Quận 1 không ra.\r\n?Giấy tờ pháp lý chuẩn, công chứng ngay.', 8),
(97, 1, 2, 939555695, '54.jpg', 'Bán Nhà Mặt', 'Trần Khắc Chân, Phường Tân Định', 7, 45, 60, 130, 2, '2022-07', '2 MẶT HẺM XE TẢI TRƯỚC SAU - CHDV - MB+15 PHÒNG - DÒNG TIỀN THU VỀ HƠN 600TR/NĂM - 151m2 - 4 TẦNG - CHỈ 13 TỶ - BAO ĐẦU TƯ\r\n\r\n- Hẻm nhựa trước nhà 6m thẳng 1 trục, cách mặt tiền 40m, thông tứ tung. Hẻm sau 5m, sạch sẽ, an ninh.\r\n\r\n- Diện tích: 151m2 ngang 4.7m2 nở hậu 10,7m, dài 20m.\r\n\r\n- CHDV: Kết cấu 1 trệt 3 lầu. Gồm mặt bằng dưới, 15 phòng khép kín. Có dòng tiền ổn định 600tr/năm.', 8),
(98, 1, 2, 972935963, '55.jpg', 'Nguyễn Văn ', 'Bùi Quang Là, Phường 12', 9, 45, 60, 130, 2, '2022-08', '+ Bán Nhà Hẻm Xe Tải Tống Văn Trân, Phường 5, Quận 11, 70m2, 9 TỶ HẠ CÒN 6.3 TỶ, RẺ BẤT NGỜ, 4 Phòng\r\n\r\n------------------------------------\r\n\r\n+ Chủ Kẹt tiền cần bán gấp 6.3 tỷ thương lượng.\r\n\r\n+ Liên hệ Mr Đồng – Bất động sản. Xem và tư vấn MIỄN PHÍ, gặp CHÍNH CHỦ thương lượng giá, CAM KẾT KHÔNG KÊ GIÁ dưới mọi hình thức.\r\n\r\n* Miễn môi giới, trung gian, báo mạng.', 8);
