(191, 1, 4, 768614693, '148.jpg', 'Nhà cần bán', 'Đường Số 22', 4, 45, 60, 130, 2, '2022-05', '- Vị trí mặt phố ô tô tránh, ngay sát hồ Bồ Đề và chợ dân sinh, khu vực dân cư đông đúc, kinh doanh sầm uất.\r\n- Trường cấp 1,2 cách nhà 200m, trong bán kính 500m là bệnh viện Tâm Anh, Trường QT Wellsprings, công an Phường\r\n- Nhà chủ tự xây ở nên rất chắc chắn, dù ở được chục năm nhưng vẫn mới, bên cạnh nhà có khe thoáng 50cm, do vậy phòng nào cũng thoáng sáng. Nhà phù hợp vừa ở vừa kinh doanh.\r\n- Diện tích nhà 40 m2, mặt tiền 7m, nhà xây 4 tầng đầy đủ công năng.\r\n- Thiết kế:\r\n+ Tầng 1: Thông sàn', 16),
